 import React from 'react';
import { Navbar, Nav, NavItem, Button } from 'react-bootstrap';
import logo from '../images/msm_logo.png';
import $ from 'jquery';

export default props => {
    $('.canvas-toggle').hide();

    function sideNav() {
   
      if ($(window).width() <= 1133) {
   
        $('.sidebar').hide();
      } else {
   
        $('.sidebar').show();
      }
   
    }
   
    $('.canvas-toggle').click(function() {
      
    });
   
   
    $(window).resize(function() {
   
      sideNav();
   
    });
    return (
        <Nav>
        <aside class='sidebar'>
        <img
                        src={logo}
                        width="55"
                        height="36"
                        className="d-inline-block align-top mt-3"
                        alt="MSM Logo"
                        />
          <div class='main-nav'>
            <ul>
           
              <li>
                <a>Dashboard</a>
                <i class="fas fa-chart-"> </i>
              </li>
              <li>
                <a>Students</a>
                <i class=""></i>
              </li>
              <li>
                <a>Teachers</a>
                <i class=""></i>
              </li>
              <li>
                <a>Parents</a>
                <i class=""></i>
              </li>
              <li>
                <a>Schedules</a>
               
              </li>
              <li>
                <a>Transportation</a>
                <i class=""></i>
              </li>
            </ul>
          </div>
        </aside>
      </Nav>
    );
};
